# You can use this model with any of the OpenAI clients in any language!
# Simply change the API Key to get started
from openai import OpenAI

client = OpenAI(
    api_key="YOUR_API_KEY",
    base_url="https://api.openai.com/v1"
)

response = client.chat.completions.create(
    model="gpt-5",
    messages=[
        {
            "role": "user",
            "content": "Generate a responsive Pomodoro timer UI in HTML/CSS/JS."
        }
    ],
    stop=[],
    stream=True,
    stream_options={
        "include_usage": True,
        "continuous_usage_stats": True
    },
    top_p=1,
    max_tokens=1000,
    temperature=1,
    presence_penalty=0,
    frequency_penalty=0
)

for chunk in response:
    if chunk.choices and chunk.choices[0].delta.content is not None:
        print(chunk.choices[0].delta.content, end="", flush=True)

const res = await fetch("https://api.openai.com/v1/chat/completions", {
    method: "POST",
    headers: {
        "Authorization": "Bearer ${API_KEY}",
        "Content-Type": "application/json"
    },
    body: JSON.stringify({
        model: "gpt-5-mini",
        messages: [{"role": "user", "content": "Explain blockchain for beginners."}]
    })
});
const data = await res.json();
console.log(data.choices[0].message.content);
